import React from 'react';

class App extends React.Component {
  state = {
    randomNumber: null,
  };

  componentDidMount() {
    fetch('/api').then(res => {
      return res.json();
    }).then(json => {
      this.setState({
        randomNumber: json.randomNumber
      })
    });
  }

  render() {
    return (
      <div>
        Random Number: {this.state.randomNumber}
      </div>
    );
  }
}

export default App;
